       (125, '2021-08-27 00:00:00.000000', 110, 'Планы Батыя',
        'Батый планирует отдать владимирское великое княжение мне, но согласно завещанию Ярослава владимирским князем должен стать Андрей, а новгородским и киевским - Я. И летописцы будут отмечать, что у них была «пря велия о великом княжении». В итоге правителями Монгольской империи, несмотря на смерть Гуюка во время похода на Батыя в 1248 году, будет реализован второй вариант.',
        false, false),
       (126, '2021-08-25 13:25:07.885368', 111, 'Давай споем!!!!',
